import styled from 'styled-components';

const Viewpost: React.FC = () => {  

    return(
        <DIV>
            <table>
                <tr>
                    <td>
                        테스트용 제목
                    </td>
                </tr>
                <tr>
                    <td>
                        사진 영역
                    </td>
                </tr>
                <tr>
                        게시물 내용
                </tr>
                <tr>
                        으음
                </tr>
            </table>
        </DIV>
    );
}

export default Viewpost;

const DIV = styled.div`
    margin-top:20px;
    margin-left:100px;
`;
